import React from "react";
import Common from "./Common";
const About =()=>{
    return(
        <>
        <Common
            name="Welcome to About Page"
            imgsrc={aboutimg}
            visit="/contact"
            btnname="Contact Now"
        />
        </>
    );
}
export default About;
